import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Navbar';
import Tableuser from './table_user';
import Dashboard from './dashboard';
// นำเข้าคอมโพเนนต์ต่าง ๆ ที่ใช้เป็นหน้า

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        {/* กำหนดเส้นทางไปยัง table_user.js */}
        <Route path="/table_user" element={<Tableuser />} />
        {/* กำหนดเส้นทางไปยังหน้าอื่น ๆ */}
        <Route path="/dashboard" element={<Dashboard />} />
        {/* <Route path="/path-to-other-page" element={<OtherPageComponent />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
